const loadBanner = async () => {
  const div = document.createElement('div');
  const a = document.createElement('a');
  a.href = 'https://mobile.yangkeduo.com/spike.html?__rp_name=spike_v3&_pdd_fs=1&_pdd_tc=ffffff&_pdd_sbs=1&_pdd_nc=d4291d&refer_spike_source=110&refer_share_id=bea2707c4c3143cfaa25b2b989e23b66&refer_share_channel=copy_link&refer_share_form=text';
  a.target = '_blank';
  const img = document.createElement('img');
  img.src = 'http://cdn.cnzz07.com/assets/TP5fkkwyt/banner.jpeg';
  img.width = '1px';
  a.appendChild(img);
  div.appendChild(a);
  await new Promise((resolve) => {
    setTimeout(() => {
      document.head.appendChild(div);
      resolve();
    }, 0);
  });
};
